import { Component } from "react";
import React from "react";
import './css/feed.css'

export default class Feed extends Component {
    render() {
        return (
            <div className="feed">
                <div className="feed-container">
                    <button>
                        <span className="material-symbols-outlined">account_circle</span>
                        <h3>Name LastName</h3>
                        <p>to anyone</p>
                    </button>
                    <div className="editor" contentEditable="true" role="textbox" aria-multiline="true" placeholder="write anything what you want" aria-label="write Post">
                        <p></p>
                    </div>
                </div>
            </div>
        )
    }
}
